contracts/Receiver.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

contract Receiver {
     function compute(uint a, uint b) external pure returns (uint sum, uint difference, uint product, uint quotient) {
        sum = a + b;
        difference = a - b;
        product = a * b;
        quotient = a / b; 
    }
}

